  <title>AntdDevelopHelper</title>
  <style>#loading .loading-center-absolute {
    position: absolute;
    top: 50%;
    left: 50%;
    width: 60px;
    height: 60px;
    margin-top: -30px;
    margin-left: -30px;
    animation: roll infinite 1s
  }

  #loading .point {
    float: left;
    width: 20px;
    height: 20px;
    margin-right: 20px;
    margin-bottom: 20px;
    border-radius: 50% 50% 50% 50%
  }

  #loading .point:nth-child(2n+0) {
    margin-right: 0
  }

  #loading .point-top-left {
    background-color: #2281f5
  }

  #loading .point-top-right {
    background-color: #f53998
  }

  #loading .point-bottom-left {
    background-color: #1d956c
  }

  #loading .point-bottom-right {
    background-color: #d9761e
  }

  @keyframes roll {
    100% {
      transform: rotate(360deg)
    }
  }</style>
  <link href="./static/css/main.7e4472d8.chunk.css" rel="stylesheet">

    <div class="point point-top-right"></div>
    <div class="point point-bottom-left"></div>
    <div class="point point-bottom-right"></div>
  </div>
</div>
